import React, { useState } from 'react';
import { Button, StyleSheet, Text, TextInput, View } from "react-native";

const SignUp = ({ navigation }) => {

    const [name, setName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");

  return (
    <View style={styles.container}>
        <Text style={styles.title}> Sign Up</Text>
        <TextInput
           style={styles.input}
           placeholder="Name"
           onChangeText={(value=> setName(value))}
           value={name}
        />
        <TextInput
           style={styles.input}
           placeholder="Email"
           onChangeText={(value=> setEmail(value))}
           value={email}
        />
         <TextInput
           style={styles.input}
           placeholder="Password"
           onChangeText={(value=> setPassword(value))}
           value={password}
        />
        <Button style={styles.button} onPress={()=> navigation.push("LogIn")} title="Sign up" />
    </View>
  )
}

export default SignUp;


const styles = StyleSheet.create({
    title: {
      textAlign: 'center',
      fontSize: 20,
      marginBottom: 50
    },
    container: {
      padding: 15,
      width: '100%',
      maxWidth: 400,
      borderColor: "#ccc",
    },
    input: {
      borderWidth: 1,
      borderColor: "#ccc",
      padding: 12,
      width: '100%',
      marginBottom: 20
    },
    button: {
       borderWidth: 1,
       backgroundColor: "red",
       borderColor: "#ccc",
       padding: 15,
       maxWidth: 100,
    }
})
